#include <stdio.h>
#include <stddef.h>
#include <stdlib.h>
#include <unistd.h>
#include <sys/time.h>
#include <fcntl.h>

/*

	Compile and run:

	clang strlen_benchmark.c && ./a.out

	and just for fun, compile and run with optimizations turned on:
	clang -O1 strlen_benchmark.c && ./a.out
	clang -O2 strlen_benchmark.c && ./a.out
	clang -O3 strlen_benchmark.c && ./a.out

	and compare output

 */

size_t	ft_strlen_ptr(const char *str)
{
	const char *start = str;

    while (*str)
        str++;
    return (str - start);
}

size_t	ft_strlen_index(const char *str)
{
	size_t	i;

	i = 0;
    while (str[i])
        i++;
    return (i);
}

long double	get_time_as_ld(void)
{
	struct timeval	time;
	long double		ld_time;

	gettimeofday(&time, NULL);

	ld_time = time.tv_sec % 1654700000;
	ld_time += (long double)time.tv_usec / 1000000.0;
	return (ld_time);
}

int main(void)
{
	const char *long_str = ""
							""
							""
							""
							"";

	size_t	len;
	size_t	count;
	count = 0;

	// make sure it does not clutter our output on the screen, but it still writes somewhere
	int fd = open("/dev/null", O_RDWR);

	long double	time_before_strlen_index_and_write;
	long double	time_after_strlen_index_and_write;
	long double	time_before_strlen_ptr_and_write;
	long double	time_after_strlen_ptr_and_write;
	long double	time_before_write_loop;
	long double	time_after_write_loop;

	long double	strlen_index_average = 0.0;
	long double	strlen_ptr_average = 0.0;
	long double	write_loop_average = 0.0;

	size_t repeats = 10;
	while (repeats)
	{

		time_before_strlen_index_and_write = get_time_as_ld();
		len = ft_strlen_index(long_str);
		write(fd, long_str, len);
		write(fd, "\n", 1);
		time_after_strlen_index_and_write = get_time_as_ld();
		strlen_index_average += time_after_strlen_index_and_write - time_before_strlen_index_and_write;

		usleep(100);

		time_before_strlen_ptr_and_write = get_time_as_ld();
		len = ft_strlen_ptr(long_str);
		write(fd, long_str, len);
		write(fd, "\n", 1);
		time_after_strlen_ptr_and_write = get_time_as_ld();
		strlen_ptr_average += time_after_strlen_ptr_and_write - time_before_strlen_ptr_and_write;

		usleep(100);

		time_before_write_loop = get_time_as_ld();
		while (long_str[count])
		{
			write(fd, &long_str[count], 1);
			count++;
		}
		write(fd, "\n", 1);
		time_after_write_loop = get_time_as_ld();
		write_loop_average += time_after_write_loop - time_before_write_loop;

		usleep(100);
		repeats--;
	}

	close(fd);

	long double fastest_strlen = strlen_ptr_average > strlen_index_average ? strlen_index_average : strlen_ptr_average;

	printf(
			"%-25s: %Lf\n"
			"%-25s: %Lf\n"
			"%-25s: %Lf\n"
			"\n"
			"write in loop is %Lf times slower than fastest strlen option\n"
			"\n"
			,
			"strlen ptr + write", strlen_ptr_average / 10,
			"strlen index + write", strlen_index_average / 10,
			"write in loop", write_loop_average / 10,
			write_loop_average / fastest_strlen
		);

	return 0;
}
